    return (
        <div className="grid grid-cols-2 w-screen"
        style={{backgroundColor :'#e5e7eb'}}>
            <div  className=" h-screen flex justify-center items-center pt-14">
                <p className=' font-bold'>Welcome to my page</p>
            </div>
            <div className="  h-screen flex justify-center items-center pt-14">
                   {GetImg.Products.map((items , index) =>{
                    return(
                        <div key={index}></div>
                    )
                   })}
            </div>
            {/* <div className="  h-screen flex justify-center items-center pt-14">
                    <img src='/static/media/comming-soon.b19db05dba490436409c.png' className='w-96 h-96'/>
            </div> */}
        </div>  
      );
}

export default LogoPage;
